import React, { useEffect } from 'react';
import { Button, Heading, TextInput } from 'evergreen-ui'
import Page from '../Components/Page';

export default function Participate() {

    const [response, setResponse] = React.useState('')
    const [person1, setPerson1] = React.useState(["", ""])
    const [person2, setPerson2] = React.useState(["", ""])
    const [person3, setPerson3] = React.useState(["", ""])


    const requestOptions = {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ title: 'React POST Request Example' })
    };

    function callApi() {
        fetch("http://localhost:9000/mail", requestOptions)
            .then(res => res.text())
            .then(res => setResponse(res))
    }

    useEffect(() => { callApi() }, []);


    return (
        <Page>
            <Heading>Enter name and email</Heading>
            <TextInput
                name="text-input-name"
                placeholder="Text input placeholder..."
                onChange={e=>setPerson1([event.target.vale, ""])}
            />
        </Page>
    );
}
